import Link from 'next/link';

const Header = () => (
<ul class="flex">
  <li class="mr-3">
  <Link href="/">
    <a class="block py-2 px-4 text-gray-900" href="#">Home</a>
    </Link>  </li>
    <li class="mr-3">
  <Link href="/about">
    <a class="block py-2 px-4 text-gray-900" href="#">About</a>
    </Link>
  </li>
</ul>
);

export default Header;
